<!DOCTYPE html>
<html lang="en">
<head>
	<meta charset="UTF-8">
	<meta name="viewport" content="width=device-width, initial-scale=1.0">
	<title>Document</title>

	<style>
		html, body {
			margin: 0;
			padding: 0;
			font-family: sans-serif;
			line-height: 1.5;
		}

		#carousel {
			height: 100vh;
			overflow-y: auto;
			overscroll-behavior-y: contain;
			scroll-snap-type: y mandatory;
			width: 100vw;
		}

		.box {
			box-sizing: border-box;
			display: grid;
			height: 100vh;
			max-height: 100vh;
			overflow: hidden;
			padding: 200px;
			place-items: center;
			scroll-snap-align: center;
			width: 100vw;

			background-color: var(--background-color);
			color: var(--color);
		}

		.box button {
			background-color: var(--color);
			color: var(--color-inverted);
		}
	</style>
</head>
<body>
	<div id="carousel">
	</div>

	<script>
		const sourceText = `
			<div>
				<h2>Some text</h2>
				<p>
					Checkmate... God help us, we're in the hands of engineers.
					So you two dig up, dig up dinosaurs? Checkmate...
					Remind me to thank John for a lovely weekend.
					Checkmate...
					We gotta burn the rain forest, dump toxic waste, pollute the air, and rip up the OZONE!
					'Cause maybe if we screw up this planet enough, they won't want it anymore!
				</p>

				<p>
					Hey, you know how I'm, like, always trying to save the planet?
					Here's my chance.
					My dad once told me, laugh and the world laughs with you, Cry, and I'll give you something to cry about you little bastard!
					Yes, Yes, without the oops! You really think you can fly that thing?
				</p>

				<button>Click me</button>
			</div>`;

		document.getElementById('carousel').addEventListener('click', async function(e) {
			if (document.fullscreenElement) {
				await document.exitFullscreen();

				e.target.scrollIntoView({
					behavior: 'smooth',
					block: 'center',
					inline: 'center',
				});
				return;
			}

			await document.getElementById('carousel').requestFullscreen();

			e.target.scrollIntoView({
				behavior: 'smooth',
				block: 'center',
				inline: 'center',
			});
		});

		const fragment = new DocumentFragment();

		for (let h = 0; h < 36; h++) {
			for (let s = 0; s < 11; s++) {
				for (let l = 0; l < 11; l++) {
					let hh = h * 10;
					let ss = s * 10;
					let ll = l * 10;

					const box = document.createElement('div');
					box.classList.add('box');
					box.id = `box-${hh}-${ss}-${ll}`;

					box.innerHTML = sourceText;
					fragment.appendChild(box);
				}
			}
		}

		document.getElementById('carousel').appendChild(fragment);
	</script>
